pragma solidity ^0.4.17;

import './DougEnabled.sol';
import './ContractProvider.sol';

contract LetterOfCreditDb is DougEnabled {

    event DocumentRegistered(bool succes, bytes32 docHash);

    struct Author {
      bytes32 name;
      bytes32 mail;
    }

    struct Document {
      bool isEntity;
      bytes32 title;
      bytes32 releaseDate;
      Author author;
    }

    mapping(bytes32 => Document) private documents; //documents[docHash] = Document
    mapping(bytes32 => bytes32[]) private documentsOfAuthor; //documentsOfAuthor[authorName] = array of docHashes

    function isDocumentRegistered(string sdocHash) external constant returns (bool, bytes32, bytes32, bytes32, bytes32) {
      require(DOUG != 0x0);
      address loc = ContractProvider(DOUG).contracts("loc");
      require(msg.sender == loc);

      bytes32 docHash = bytes32(keccak256(sdocHash));
      if (documents[docHash].isEntity)
          return (true, documents[docHash].title, documents[docHash].releaseDate, documents[docHash].author.name, documents[docHash].author.mail);
      else
          return (false, 0x0, 0x0, 0x0, 0x0);
    }

    //if already registered return metadata
    function registerDocument(string sdocHash, bytes32 title, bytes32 releaseDate, bytes32 authorName, bytes32 authorMail) external returns (bool, bytes32, bytes32, bytes32, bytes32) {
        require(DOUG != 0x0);
        address loc = ContractProvider(DOUG).contracts("loc");
        require(msg.sender == loc);

        bytes32 docHash = bytes32(keccak256(sdocHash));
        if (documents[docHash].isEntity) {
          DocumentRegistered(false, docHash);
          return (false, documents[docHash].title, documents[docHash].releaseDate, documents[docHash].author.name, documents[docHash].author.mail);
        }
        else {
          documents[docHash] = Document(true, title, releaseDate, Author(authorName, authorMail));
          documentsOfAuthor[authorName].push(docHash);
          DocumentRegistered(true, docHash);
          return (true, 0x0, 0x0, 0x0, 0x0);
        }
    }

	//nog functie maken om aantal van author op te vragen + hier extra parameters: fromIndex, amount
	//contracten kunnen namelijk geen dynamic arrays uitwisselen onder elkaar
    function getDocumentListFromAuthor(bytes32 authorName) external constant returns (uint256 nrOfDocuments, bytes32 authorMail, bytes32[50] titles, bytes32[50] releaseDates) {
        require(DOUG != 0x0);
        address loc = ContractProvider(DOUG).contracts("loc");
        require(msg.sender == loc);

        nrOfDocuments = documentsOfAuthor[authorName].length;
        if (nrOfDocuments > 0) {
            //titles = new bytes32[](nrOfDocuments);
            //releaseDates = new bytes32[](nrOfDocuments);
            authorMail = documents[documentsOfAuthor[authorName][0]].author.mail;
            for (uint i=0; i<nrOfDocuments; i++) {
                titles[i] = documents[documentsOfAuthor[authorName][i]].title;
                releaseDates[i] = documents[documentsOfAuthor[authorName][i]].releaseDate;
            }
        }
        return (nrOfDocuments, authorMail, titles, releaseDates);
    }

